var professeurGuard = (route, state2) => {
  const router = inject(Router);
  const utilisateurService = inject(UtilisateurService);
  const sessionData = localStorage.getItem(environment.UTILISATEUR_SESSION_KEY);
  if (sessionData != null) {
    const role = utilisateurService.getInfoFromToken("role");
    if (role == "prof") {
      return true;
    }
    router.navigateByUrl("accueil_Etudiant");
    return false;
  } else {
    router.navigateByUrl("login");
    return false;
  }
};

// src/app/shared/guard/login.guard.ts
var loginGuard = (route, state2) => {
  const router = inject(Router);
  const utilisateurService = inject(UtilisateurService);
  const sessionData = localStorage.getItem(environment.UTILISATEUR_SESSION_KEY);
  const role = localStorage.getItem(environment.UTILISATEUR_ROLE_KEY);
  if (sessionData != null) {
    const role2 = utilisateurService.getInfoFromToken("role");
    if (role2 == "prof") {
      router.navigateByUrl("accueil_Enseignant");
    } else {
      router.navigateByUrl("accueil_Etudiant");
    }
    return false;
  } else {
    return true;
  }
};

